import "./PriceStyles/Prices.css";
function Prices() {
  return (
    <div className="price">
      <p>Cryptocurrancy Prices By Market Cap</p>
      <div className="priceCont">
          <div>
              <p>$2222,222222,22222,222222</p>
              <p></p>
          </div>
          <div>2</div>
          <div>3</div>
      </div>
    </div>
  );
}
export default Prices;
